//  string AirYesterdayUseValue  = 5; // 昨日花费空调电量
//  string AirYesterdayUseMoney       = 6; // 昨日花费空调电费
//}
//
//// 请求体
//message SetStandardRequest {
//  string studentId =1;
//  int64 money       = 2;  //金额
//  Place place = 3;
//}
//
//message Place{
//  string area       = 2;  //区域
